import React from 'react'
import {Link} from 'react-router-dom'
const MenubarAdmin = () => {
  return (
    <div>
        <ul className='nav flex-column'>
            <li className='nav-item'> <link to="">แดชบอร์ด</link> </li>
            <li className='nav-item'> <link to="">จัดการผู้ใช้งาน</link></li>
        </ul>
    </div>
  )
}

export default MenubarAdmin
